import styles from './style.module.scss';

export function LoginView({form, onInputChange, onFormSubmit, emailProps}) {
    return (
        <div>
            <div className={styles.left_side}></div>
            <div>
                <form>
                    <input 
                        name="email"
                        {...emailProps}/>
                </form>
            </div>
        </div>
    )
}
